script: |
  super -f text -I q4156.spq | sort > q4156.out

inputs:
  - name: q4156.spq
    data: |
      SELECT DISTINCT col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + ( - 61 ) / 88 - + + ( - col0 ) - - + 61 + - 59 IS NULL;
  - name: tab0

outputs:
  - name: q4156.out
    data: |
      1
      21
      81
